    "2016-05-25T00:33:03.740360",nt"name": "the-omnibus-surveys-faa-sponsored-safety-seminars-0bc29",nt"isopen":
    true,nt"url": null,nt"notes": "The Omnibus Surveys are a convenient way
    to get very quick input on transportation issues; to see who uses what, how they
    use it, and how users view it, and what they think about it; and to gauge public
    satisfaction with the transportation system and government programs.The series of
    surveys include:       A monthly household survey of 1,000 households each month,
    which collects data on core questions about general travel experiences, satisfaction
    with the system, and some demographic data.      Targeted surveys to address special
    transportation issues, as the U.S. Department of Transportation (DOT) operating
    administrations need them",nt"license_title": "U.S. Government Work",nt"extras":
